// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMRData(char *Buffer)
{
    memcpy(Buffer, &JMRL0[1], JMRL0[0] << 2);
    Buffer += (JMRL0[0] << 2);

    memcpy(Buffer, &JMRL1[1], JMRL1[0] << 2);
    Buffer += (JMRL1[0] << 2);

    memcpy(Buffer, &JMRL2[1], JMRL2[0] << 2);
    Buffer += (JMRL2[0] << 2);

    memcpy(Buffer, &JMRL3[1], JMRL3[0] << 2);
    Buffer += (JMRL3[0] << 2);

    memcpy(Buffer, &JMRL4[1], JMRL4[0] << 2);
    Buffer += (JMRL4[0] << 2);

    memcpy(Buffer, &JMRB[1], JMRB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMRName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMRData(void)
{
    remove(JMRName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMRData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMRName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMRName)) return "";
    #endif

    if (!(han = fopen(JMRName, "wb"))) return "";
    if (AutoClean) atexit(KillJMRData);

    num = fwrite(&JMRL0[1], 4, JMRL0[0], han);
    if (num != JMRL0[0]) {fclose(han); return "";}

    num = fwrite(&JMRL1[1], 4, JMRL1[0], han);
    if (num != JMRL1[0]) {fclose(han); return "";}

    num = fwrite(&JMRL2[1], 4, JMRL2[0], han);
    if (num != JMRL2[0]) {fclose(han); return "";}

    num = fwrite(&JMRL3[1], 4, JMRL3[0], han);
    if (num != JMRL3[0]) {fclose(han); return "";}

    num = fwrite(&JMRL4[1], 4, JMRL4[0], han);
    if (num != JMRL4[0]) {fclose(han); return "";}

    num = fwrite(&JMRB[1], 1, JMRB[0], han);
    if (num != JMRB[0]) {fclose(han); return "";}

    fclose(han);
    return JMRName;
}

